The @greatelephantmigration began its final leg—1,000 miles west to the Pacific. We gathered at the foot of the Tetons, surrounded by the wild landscape of Jackson Hole, to send off the herd, created by @therealeleco, with love, music, and deep intention.

These 100 life-sized Indian elephants have already traveled so far, sharing a powerful story from the Nilgiri Hills in India, where elephants live in some of the most densely populated human landscapes on Earth, and yet still find ways to coexist. As they travel, they are raising millions to power human-wildlife coexistence through the sale of sculptures. Their presence is a reminder that peaceful cohabitation isn’t just possible, it’s necessary.

I have witnessed the intelligence, grief, tenderness, and resilience of wild elephants and this moment feels deeply personal. These sculptures carry the spirit of their living counterparts—gentle giants navigating shrinking habitats, climate threats, and human pressures. They ask us to see them. To care. To act.

Over the next five days, we’ll transport the herd together in a convoy of brightly decorated pick-up trucks, each one transformed with the vivid poetry and art of Indian truck culture, crossing deserts and mountains toward the coast. It’s a tribute not just to animal migration, but to cultural migration. To beauty. To connection across continents. 

In a time when the world feels fractured, this journey matters. It’s a call to remember what we share. What we can still protect. What wildness still remains, and how much more it means when we choose to make space for it.

